import React, { useState } from 'react';
import './styles.css';
import { Link } from 'react-router-dom';
import axios from 'axios';
import logo from './squarechesslogolong.png';
import logoWhite from './squarechesslogolongwhite.png';

const LandingPage = () => {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const [isLogoHovered, setIsLogoHovered] = useState(false);
    const [errorMessage, setErrorMessage] = useState('');
    const [successMessage, setSuccessMessage] = useState('');

    const handleUsernameChange = (e) => {
        setUsername(e.target.value);
    };

    const handlePasswordChange = (e) => {
        setPassword(e.target.value);
    };

    const handleLogin = async () => {
        if (!username || !password) {
            setErrorMessage('Both fields are required.');
            return;
        }

        try {
            const response = await axios.post('http://localhost:3001/api/auth/login', { username, password });
            setSuccessMessage('Login successful!');
            console.log(response.data);
        } catch (error) {
            if (error.response) {
                setErrorMessage(error.response.data.message || 'Login failed.');
            } else if (error.request) {
                setErrorMessage('No response from server.');
            } else {
                setErrorMessage('Error: ' + error.message);
            }
        }
    };

    return (
        <div className="landing-page">
            <header>
                <nav>
                    <ul>
                        <li
                            onMouseEnter={() => setIsLogoHovered(true)}
                            onMouseLeave={() => setIsLogoHovered(false)}>
                            <Link to="/">
                                <img src={isLogoHovered ? logoWhite : logo} alt="Home" style={{ height: '40px' }} />
                            </Link>
                        </li>
                        <li><Link to="/" className="prepare-link">Blunder Punisher</Link></li>
                        <li><Link to="/">Weakness Finder</Link></li>
                        <li><Link to="/analysis-board">Analysis Board</Link></li>
                        <li><Link to="#about-us">About Us</Link></li>
                    </ul>
                </nav>
            </header>

            <main>
                <section className="hero">
                    <section className="login-section">
                        <div className="login-form">
                            {errorMessage && <p className="error-message">{errorMessage}</p>}
                            {successMessage && <p className="success-message">{successMessage}</p>}
                            <input
                                type="text"
                                placeholder="Username"
                                value={username}
                                onChange={handleUsernameChange}
                            />
                            <input
                                type="password"
                                placeholder="Password"
                                value={password}
                                onChange={handlePasswordChange}
                            />
                            <button className="login-button" onClick={handleLogin}>Log In</button>

                            <div className="create-account-div">
                                <p>Don't have an account?</p>
                                <button className="create-account-button">
                                    <Link to="/signup">Create a SquareChess Account</Link>
                                </button>
                            </div>
                        </div>
                    </section>
                    <div className="recommendation-section">
                        <div className="green-box">
                            <p>More than 500 Users Recommended by GMs</p>
                        </div>
                    </div>
                </section>
            </main>

            <footer>
                <p>&copy; 2024 SquareChess.org All rights reserved.</p>
            </footer>
        </div>
    );
};

export default LandingPage;
